import React from 'react';

function Home() {
  return (
    <div>

            <h6 class="title is-6">Bienvenido a CarFix</h6>

              <div class="columns is-mobile is-centered">
                  <h4 class="title is-4">Asistencia para las emergencias de tu auto en donde estés</h4>
                  <h6 class="title is-6">Carfix está para apoyarte con las principales emergencias de tu auto como:</h6>
                  <li class="title is-6">Cambio de llanta de refacción</li>
                  <li class="title is-6">Paso de corriente a batería</li>
                  <li class="title is-6">Servicio de grúa</li>
                  <li class="title is-6">Abasto de combustible</li>
                  <a  class=" button is-success" href="/auth/signup"><strong>Regístrate</strong></a>
                </div>

    </div>
  );
}

export default Home;
